import ReactEcharts from 'echarts-for-react';
import { Progress } from 'antd';

export default class Top2 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {   
        };
    }
 
    render() {
        return (
			<div className="top2">
				<div>
					<div>温度</div>
					<div>湿度</div>
					<div>TVOC</div>
					<div>甲醛</div>
					<div>PM2.5</div>
					<div>氨</div>
				</div>
				<div style={{ width: '60%',lineHeight: '1%'}}>
					<Progress strokeColor={{from: '#0033FF',to: '#00CCFF',}} percent={18} size="small" />
					<Progress strokeColor={{from: '#0033FF',to: '#00CCFF',}} percent={90} size="small" />
					<Progress strokeColor={{from: '#0033FF',to: '#00CCFF',}} percent={30} size="small" />
					<Progress strokeColor={{from: '#0033FF',to: '#00CCFF',}} percent={50} size="small" />
					<Progress strokeColor={{from: '#0033FF',to: '#00CCFF',}} percent={66} size="small" />
					<Progress strokeColor={{from: '#0033FF',to: '#00CCFF',}} percent={12} size="small" />
				</div>
				<div>
					
				</div>
			</div>
			
        )
    }
}
